    + "			</div>\n		</div>\n\n		<div class=\"menu-content-block\">\n\n			<p>Welcome to the ‘Biomarkers and their Emerging Role in Lung Cancer: Foundation Module’, which has been designed to provide you with the relevant knowledge needed to understand biomarkers and their evolving role in non-small cell lung cancer (NSCLC). <br><br> The module should take 60 minutes to complete, with an additional 60 minutes of pre-reading that you can find in the resources section next to the module on the ONiP website. <br><br> We begin with a pre-assessment of your experience of biomarkers. Then, there are five topics, a test and a post-assessment. As soon as you complete a topic, the next topic will get unlocked.</p> <ul>By completing this module, you should be able to:<br><br><li>Identify different biomarkers and the therapies that target them </li> <li>Describe the side effects associated with these therapies and how these should be managed</li> <li>Discuss ways you should consider educating your patients on the side effects that may occur</li></ul>\n		</div>\n\n	</div>\n\n	\n<!--<div class=\"content_block\">	<hr>			\n			// <span class=\"module-title\"><b>Learning objective</b></span><br><br> \n			<div class=\"content-block-inner accessible-text-block\">					\n					<span class=\"module-body-text\">	\n						<img src=\"course/en/images/Objective_img.png\" alt=\"learning objective\"/><br><br>\n						<p>By completing this module, you should be able to:</p>\n					</span>							\n			</div>\n	</div>\n	<div class=\"objective-block\">					\n		<div class=\"purple-block\">\n			<p>Identify different biomarkers and the therapies that target them </p>\n		</div>\n		<div class=\"yellow-block\">\n			<p>Describe the side effects associated with these therapies and how these should be managed</p>\n		</div>\n		<div class=\"pink-block\">\n			<p>Discuss ways you should consider educating your patients on the side effects that may occur</p>\n		</div>\n		<div class=\"blue-block\">\n			<p>Discuss the role of the clinical nurse specialist in managing patients with NSCLC</p>\n		</div>		\n	</div> -->\n\n	<div class=\"menu-bottom-block\"> This independent educational activity is supported by funding from AstraZeneca Pharmaceuticals through the National Lung Cancer Forum for Nurses. PCM Scientific is the medical education company acting as scientific secretariat and organiser for this programme. The activity is run independently of the financial supporter and all content is created by the faculty. No funder has had input into the content of the activity.</div>\n\n	<div class=\"aria-label relative a11y-ignore-focus prevent-default\" tabindex=\"0\" role=\"region\">"
